import React, { useState } from 'react';
import Layout from '../Layout/Layout';
import './project.css';
import CtCard from '../Ui Kits/Cart/CT Card/CtCard';
import { NavLink } from 'react-router-dom';
import Ct_data from '../../Ct_data';
// images
import html from '../Assets/Images/Project Image/html.png';
import javascript from '../Assets/Images/Project Image/javascript.png';
import bootstrap from '../Assets/Images/Project Image/bootstrap.png';
import react from '../Assets/Images/Project Image/react.jpg';
import wordpress from '../Assets/Images/Project Image/wordpress.jpg';
import design from '../Assets/Images/Project Image/design.jpg';

function Project(props) {
  const [ct, setCt] = useState();
  return (
    <div>
      <Layout>
        <div className='pr_main_div'>
          <h1>Project Category</h1>
          <div
            className='category'
            value='ct'
            onChange={(event) => {
              setCt(event.target.value);
            }}
          >
            {/* --- html/css Start--- */}
            <NavLink
              exact
              className='nav-link active'
              to='/category/:value'
              value='htmlcss'
            >
              <CtCard ct_title='Html / css' image={html} value='htmlcss' />
            </NavLink>
            {/* --- html/css End--- */}

            {/* --- javascript Start--- */}
            <NavLink exact className='nav-link active' to='/'>
              <CtCard ct_title='javascript' image={javascript} />
            </NavLink>
            {/* --- javascript End--- */}

            {/* --- bootstrap Start--- */}
            <NavLink exact className='nav-link active' to='/'>
              <CtCard ct_title='bootstrap' image={bootstrap} />
            </NavLink>
            {/* --- bootstrap End--- */}

            {/* --- react Start--- */}
            <NavLink exact className='nav-link active' to='/'>
              <CtCard ct_title='react' image={react} />
            </NavLink>
            {/* --- react End--- */}

            {/* --- wordpress Start--- */}
            <NavLink exact className='nav-link active' to='/'>
              <CtCard ct_title='wordpress' image={wordpress} />
            </NavLink>
            {/* --- wordpress End--- */}

            {/* --- design Start--- */}
            <NavLink exact className='nav-link active' to='/'>
              <CtCard ct_title='design' image={design} />
            </NavLink>
            {/* --- design End--- */}
          </div>
        </div>
      </Layout>
    </div>
  );
}

export default Project;
